import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="home-container">
      {/* React typically doesn't use <head> inside components, 
          but keeping it here if you specifically want it */}
      <head>
        <link rel="icon" href="/images/placeholder-logo.png" />
        <title>Pixelate</title>
      </head>

      {/* HEADER / TOP SECTION */}
      <header className="header-section">
        <div className="header-content">
          {/* Logo or brand image */}
          <img
            src="/images/placeholder-logo.png"
            alt="Pixelate Logo"
            className="header-logo"
          />
          {/* You can keep your brand name if you prefer text */}
          <h1 className="brand-name">PIXELATE</h1>
        </div>
      </header>

      {/* HERO / SLOGAN SECTION */}
      <section className="hero-section">
        <div className="hero-content">
          <h2 className="hero-slogan">Slogan</h2>
          <p className="hero-subtext">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit.
            Quisque porta eros id ullamcorper consequat.
          </p>
          <button className="hero-button">Get Started</button>
        </div>
      </section>

      {/* ABOUT PIXELATE SECTION */}
      <section className="about-section">
        <h2>About Pixelate</h2>
        <div className="stats-container">
          <div className="stat-box">
            <h3>Stat</h3>
            <p>Lorem ipsum</p>
          </div>
          <div className="stat-box">
            <h3>Stat</h3>
            <p>Lorem ipsum</p>
          </div>
          <div className="stat-box">
            <h3>Stat</h3>
            <p>Lorem ipsum</p>
          </div>
          <div className="stat-box">
            <h3>Stat</h3>
            <p>Lorem ipsum</p>
          </div>
        </div>
      </section>

      {/* OUR SERVICES SECTION */}
      <section className="services-section">
        <h2>Our Services</h2>
        <div className="services-wrapper">
          {/* Left side: list of services */}
          <div className="services-list">
            <p>Photo Lifting</p>
            <p>Restoration</p>
            <p>Lorem</p>
            <p>Lorem</p>
          </div>
          {/* Center illustration (placeholder) */}
          <div className="services-illustration">
            <img
              src="/images/placeholder-illustration.png"
              alt="Services Illustration"
            />
          </div>
          {/* Right side: another service highlight */}
          <div className="services-highlight">
            <h3>All in one hub for CAD</h3>
            <p>
              Lorem ipsum dolor sit amet, consectetur adipiscing elit.
              Quisque rutrum quam a ligula sollicitudin, quis lacinia diam egestas.
            </p>
          </div>
        </div>
      </section>

      {/* CONTACT US SECTION */}
      <section className="contact-section">
        <h2>Contact Us</h2>
        <p className="contact-text">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit.
          Nullam pulvinar, orci eget gravida feugiat, nisi lorem faucibus magna,
          quis semper augue lectus eu sapien.
        </p>
        <ul className="contact-details">
          <li><strong>Location:</strong> 1234 Example St, City, Country</li>
          <li><strong>Email:</strong> info@pixelate.com</li>
          <li><strong>Phone:</strong> +1 (123) 456-7890</li>
        </ul>
      </section>

      {/* FOOTER */}
      <footer className="footer-section">
        <p>© 2023 Pixelate. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default Home;
